export default function Services(){

    return(
        <div className="template">
          <h1>We offer many services</h1>

          <ol>
            <li>Clogged toilet 50$</li>
            <li>Clogged sink 30$</li>
            <li>New construction 50$ a hour</li>
          </ol>
        </div>
    )
}
